import React from 'react';
import { styled } from 'styled-components';

const Container = styled.div`
  margin-top: 100px;
  display: flex;
  flex-direction: column;
`;

const Banner = styled.div`
  width: 100%;
`;

const Phanplat = styled.div`
  width: 100%;
`;

const Category = styled.div`
  width: 100%;
  height: 130px;
  background-color: #F2F2F2;
  border: 1px solid red;
`;

const Ul = styled.div`
  height: 100%;
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  border: 1px solid red;
  li {
    list-style: none;
    font-weight: bold;
    img {
      width: 70px;
      height: 70px;
    }
  }
`;

const Main = () => {
  return (
    <Container>
      <Banner>
        <img src='http://m.shop1.markgonzales.cafe24.com/images/MOBILE/M-main1.jpg'/>
        <img src='http://m.shop1.markgonzales.cafe24.com/images/MOBILE/M-main-2_---11.gif'/>
      </Banner>
      <Category>
        <Ul>
          <li>
            <img src='https://wiisnt.co.kr/web/product/extra/small/20230508/e6e0179496561247b40520060be53070.jpg'/>
            <span>BEST</span>
          </li>
          <li>
            <img src=''/>
            <span>NEW</span>
          </li>
          <li>
            <img src=''/>
            <span>TOP</span>
          </li>
          <li>
            <img src=''/>
            <span>BOTTOM</span>
          </li>
          <li>
            <img src=''/>
            <span>WOMAN</span>
          </li>
          <li>
            <img src=''/>
            <span>아울렛</span>
          </li>
        </Ul>
      </Category>
      <Phanplat>
        <img src='http://m.shop1.markgonzales.cafe24.com/images/MOBILE/230707_01_.jpg'/>
        <img src='http://m.shop1.markgonzales.cafe24.com/images/MOBILE/230703_03_1.jpg'/>
      </Phanplat>
    </Container>
  )
}

export default Main;
